    {
      id: DataTypes.STRING,
      Sdt: DataTypes.INTEGER,
      Mail: DataTypes.STRING,
      DiaChi: DataTypes.STRING,
      Matkhau: DataTypes.STRING,
      Role: DataTypes.INTEGER,
    },
    {
      sequelize,
      modelName: "Account",
    }
  );
  return Account;
};

