  User.init(
    {
      mail: DataTypes.STRING,
      sdt: DataTypes.STRING,
      matkhau: DataTypes.STRING,
      avatar: DataTypes.BLOB,
      role: DataTypes.INTEGER,
    },
    {
      sequelize,
      modelName: "User",
    }
  );
  return User;
};

